// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import RenewableEnergyDirectory from './pages/RenewableEnergyDirectory';
import RenewableEnergy from './pages/RenewableEnergy';
import EducationalResources from './pages/EducationalResources';
import CommunityProjects from './pages/CommunityProjects';
import Contacts from './pages/Contacts';
import AboutUs from './pages/AboutUs';
import Footer from './Footer'; // Import Footer component
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';

const App = () => {
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/renewable-energy-directory" element={<RenewableEnergyDirectory />} />
          <Route path="/renewable-energy" element={<RenewableEnergy />} />
          <Route path="/educational-resources" element={<EducationalResources />} />
          <Route path="/community-projects" element={<CommunityProjects />} />
          <Route path="/contacts" element={<Contacts />} />
          <Route path="/about-us" element={<AboutUs />} />
        </Routes>
        <Footer /> 
      </div>
    </Router>
  );
};

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark" style={{ backgroundColor: '#468585' }}>
      <div className="container">
        <Link className="navbar-brand" to="/">Logo</Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item">
              <Link className="nav-link" to="/renewable-energy-directory">Renewable Energy Directory</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/renewable-energy">Renewable Energy</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/educational-resources">Educational Resources</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/community-projects">Community Projects</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/contacts">Contacts</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/about-us">About Us</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default App;
